package main.java.Leetcode;

import java.util.HashMap;

public class ValidAnagram {
    public static void main(String[] args) {
        System.out.println(checkValidAnagram("", ""));
    }

    public static boolean checkValidAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        HashMap<Character, Integer> sMap = new HashMap<>();
        HashMap<Character, Integer> tMap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            sMap.put(s.charAt(i), sMap.getOrDefault(s.charAt(i), 0) + 1);
            tMap.put(t.charAt(i), tMap.getOrDefault(t.charAt(i), 0) + 1);
        }
        System.out.println(sMap.toString());
        System.out.println(tMap.toString());

        if (!sMap.equals(tMap)) {
            return false;
        }
        // the below could work- note that we cast an int because we are comparing Integer references
//        for (char keys : sMap.keySet()) {
//            if ((int) sMap.get(keys) != (int) tMap.getOrDefault(keys, 0)) {
//                return false;
//            }
//        }
        return true;
    }
}
